args.description:
(Optional) A map of request query string parameters and headers that should be passed to the integration.
For example: request_parameters = { 
"method.request.header.X-Some-Header" = true,
"method.request.querystring.some-query-param"  = true,
}

would define that the header X-Some-Header and the query string some-query-param must be provided on the request, or

(Optional) A map of response parameters that can be sent to the caller.
 For example: response_parameters = { "method.response.header.X-Some-Header" = true }
 would define that the header X-Some-Header can be provided on the response.

(Optional, Forces new resource) Describe an LSI on the table;
these can only be allocated at creation so you cannot change this
definition after you have created the resource.

(Optional) Describe a GSO for the table;
subject to the normal limits on the number of GSIs, projected
attributes, etc.
